import React from 'react';

function App() {
  return (
  <div className="App" >
    <div className="mx-8">
      <div className="text-center">
        <img className="mt-24 h-5 m-auto" src="./images/logo.svg" alt="Logo"/>
        <h3 className="mt-16 text-red-700 font-thin text-2xl">We are launching <span className="text-blue-dark font-bold">soon!</span></h3>
        <h5 className="">Subscribe and get notified</h5>
      </div>
      <div className="flex flex-col mt-8 bg-red-500 w-full">
        <div className="border py-3 rounded-full">
          <input className="ml-10 text-sm" type="email" placeholder="Your email address" />
        </div>
        <button className="block mt-4 py-3 rounded-full bg-blue-primary shadow-lg font-semibold">Notify Me</button>
      </div>
    </div>
  </div>
  );
}

export default App;
